import React from 'react';
import './3DGraphics.css'
export default function Graphics3D() {
    return (
      <div class="c-work__hero-desc">
        <h1 class="c-work__title js-bounce-in" style={{opacity: 1, transform: "translateY(0px)"}}>Jeffsum.</h1>
        <span class="c-work__breakdown js-bounce-in" style={{opacity: 1, transform: "translateY(0px)"}}>Chief Idiot • UI / UX / Development • 2018</span>
      </div>
    )    
}
